import React from "react";
import Navigation from "../composent/Navigation";
import "../Style/Style.css";
import logo from '../assets/logo.g'

const Home = () => {
  return (
    <div>
      <Navigation />
      <h1 className="title">Accueil</h1>
      <img src={logo} alt='La maison jungle' className='lmj-logo' />
    </div>
  );
};

export default Home;
